import { Box } from "@mui/system";
import "./Home.css";
import React from "react";
import { Paper, Typography, IconButton, Button, Stack, Divider,   } from "@mui/material";
import { Close } from "@mui/icons-material";
import { styled, useTheme } from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardMedia from '@mui/material/CardMedia';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import { useGetproducsByNameQuery } from '../../Redux/producsApi'




const receviedDataFromAPI=[ {},{},{},{}]


const Home = () => {
  const theme=useTheme();
  const { data, error, isLoading } = useGetPokemonByNameQuery('bulbasaur')

  return (



      <Box >
        <Card sx={{width:'auto',mx:'auto',justifyContent:'center',display:'flex'}}>
        <CardHeader title="Settlement & Villages"/>

  </Card>
        <Stack direction={'row'} sx={{flexWrap:'wrap', justifyContent:'center'}}>

          {receviedDataFromAPI.map((item) => {
            return(

              <Card sx={{ maxWidth: 277,mb:6,mx:2 }}>
          <CardHeader

            action={
              <IconButton aria-label="settings">
                <MoreVertIcon />
              </IconButton>
            }
            title="Alzubbara"

          />
          <CardMedia
            component="img"
            height="194"
            image="###"
            alt="Paella dish"
          />
          <CardContent>
            <Typography variant="body2" color="text.secondary">
              This impressive paella is a perfect party dish and a fun meal to cook
              together with your guests. Add 1 cup of frozen peas along with the mussels,
              if you like.
            </Typography>
          </CardContent>
          <CardActions sx={{justifyContent:'space-between'}} disableSpacing>
            <Button sx={{textTransform:'capitalize'}} variant="text" color="primary">
              add to Cart
            </Button>
            <Typography mr={1} variant="body1" color={theme.palette.error.light}>$100</Typography>
          </CardActions>

        </Card>
            )

          })}

        </Stack>
      </Box>


  );}

export default Home;
